import React from 'react';

import './tags.styles.css';

const Tags = ({ filteredTags }) => (
  <div className='tag-container'>
    {
      filteredTags.map((item, index) => (
        !item.length ? <span>not found</span> :
        <span key={index}>{ item }</span>
      ))
    }
  </div>
);

export default Tags;
